import React, { useState } from 'react';
import axios from 'axios';

const Results = ({ options, onSelect }) => {
  const [f1ScoreList, setF1ScoreList] = useState(false);


  const generateF1Scores = () => {

    try {
      const response = axios.post('/f1score');
      console.log(response.data);
      if (response.data.success) {

        setF1ScoreList(response.data.f1_score_all)
      }
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="grid-dropdown">
      <button onClick={generateF1Scores}>Generate F1 Scores</button>

      <img src={f1ScoreList}/>
    </div>
  );
};

export default Results;
